import React from 'react';

export function Cart({ cartItems }) {
    return (
      <>
        <h2>Kocsi</h2>
        <ul>
          {Object.keys(cartItems).map((itemName, index) => (
              <li key={index}>
                  {itemName} - {cartItems[itemName]} db
              </li>
          ))}
        </ul>
      </>

      );
};
